import React from "react";

const PlateItems = (
  { macro: { nutrientName, unitName, value } },
  { name }
) => {
  return (
    <tr>
      <th>{name}</th>
      <th>1</th>
      <th>2</th>
      <th>3</th>
      <th>4</th>
    </tr>
  );
};

export default PlateItems;
